dsprojeto:
O Núcleo Setorial de Paisagismo da ACIF – Associação Comercial e Industrial de Florianópolis, foi criado em 18 de março de 2010 com o objetivo:
•	Contribuir para quebrar o isolamento da micro e pequena empresa;
•	Promover o associativismo;
•	Promover o desenvolvimento da empresa, do seu setor e da economia;
•	Aumento do grau de competitividade das empresas participantes;
•	Melhoria do patamar tecnológico e gerencial das empresas;
•	Busca de novos mercados, minimizando assim a dependência da grande     empresa;
•	Melhoria da qualidade dos produtos ou serviços;
•	Maior sinergia com a grande empresa;
•	Troca de experiências com outros empresários do mesmo setor;
•	Redução da mortalidade das empresas;
•	Acesso facilitado a consultorias, treinamentos, enfim, ao conhecimento estratégico;
Consolidação do processo de formação de redes de apoio às empresas, visando facilitar o acesso ao crédito, à informação e a formação profissional.
Nesses três anos, através do Núcleo as empresas já realizaram as seguintes ações: 
•	Missões Empresariais;
•	Semana de Paisagismo;
•	Mostra de Paisagismo;
•	Capacitações;
•	Exposições em Feira;
•	Projetos; 
As empresas que atuam na área de paisagismo, faz parte da cadeia da construção civil.
Paisagismo é a arte e técnica de planejar, projetar, fazer a gestão de espaços livres de forma a criar paisagens, sendo ainda aplicado por estética, funcionalidade, segurança, conforto dos ambientes.

