Mapeamento dos negócios rurais locais;
Implementação de um serviço de referência na associação comercial.

dsresultado2:
Formar 2 núcleos setoriais e cadastrar as empresas nucleadas no Portal do Empreender com seus respectivos planos de ações;
Oferta de linha de crédito e serviços financeiros diferenciados para pequenos produtores rurais;
Estudo de adoção de mensalidades diferentes para bancos, prefeituras e grandes empresas.

dsobjetivo:
Promover a qualificação de lideranças femininas para o desenvolvimento competitivo de empresas que integram núcleos de mulheres empresárias no Brasil, considerando os seguintes aspectos: mercado, finanças, processos, pessoas e inovação. 

São objetivos específicos desta iniciativa:
•	Entregar empresas mais competitivas, preparadas e bem posicionadas ao mercado;
•	Preparar empresárias para o alcance de melhor desempenho empresarial e institucional;
•	Ampliar a participação das mulheres em cadeiras de diretorias nas entidades empresariais e fortalecer o movimento de mulheres empresárias no Brasil.

